#include "common.h"
using namespace std;

namespace subarrayBitwiseORs {

class Solution {
public:
    int subarrayBitwiseORs(vector<int>& A) {
        unordered_set<int> res;
        int n = A.size();
        int max = 0;
        for (int k = n - 1; k >= 0; --k) {
            max |= A[k];
            int r = 0;
            for (int i = k; i < n; ++i) {
                r |= A[i];
                res.insert(r);
                if (r == max) {
                    break;
                }
            }
        }
        return res.size();
    }

private:
};

}

